import React from 'react';
import NavBar from './NavBar';

const Header = () => {
  return (
    <div className="bg-gray-200" >
        <h1><img 
        className="h-24 mx-auto py-4" 
        src="./public/logo.png" 
        alt="Hello FullStack" 
        height="80" />
        </h1>
        <NavBar/>
      </div>
  )
}

export default Header;
